import React from 'react';
import { NavLink } from 'react-router-dom';
import { Navbar, Nav, NavDropdown } from 'react-bootstrap';

const Navigation = () => {
    return (
        <Navbar expand="lg" bg="light" variant="light">
            <Navbar.Brand as={NavLink} to="/">
                <img src="images/logo-fotor-2025031022326.png" alt="Logo" height="50" style={{ borderRadius: '20px' }} />
            </Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="ms-auto">
                    <NavDropdown title="Услуги" id="basic-nav-dropdown">
                        <NavDropdown.Item as={NavLink} to="/make-keys">Изготовление ключей</NavDropdown.Item>
                        <NavDropdown.Item as={NavLink} to="/chip-recording">Запись Чипов</NavDropdown.Item>
                        <NavDropdown.Item as={NavLink} to="/key-recovery">Восстановление Ключей и Чипов</NavDropdown.Item>
                        <NavDropdown.Divider />
                        <NavDropdown.Item as={NavLink} to="/lock-opening">Вскрытие и Ремонт Автозамков</NavDropdown.Item>
                    </NavDropdown>
                    <Nav.Link as={NavLink} to="/contacts">Контакты</Nav.Link>
                </Nav>
            </Navbar.Collapse>
        </Navbar>
    );
}

export default Navigation;
